import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
    return (
        <nav style={styles.nav}>
            <h1>Galería de Proyectos</h1>
            <div style={styles.links}>
                <Link to="/" style={styles.link}>Inicio</Link>
                <Link to="/crear" style={styles.link}>Crear Expositor</Link>
                <Link to="/expositores" style={styles.link}>Lista de Expositores</Link>
                <Link to="/galeria" style={styles.link}>Lista Galería</Link> {/* Nuevo botón */}
                <Link to="/crear-galeria" style={styles.link}>Crear Galería</Link>
                <Link to="/crear-premio">Crear Premio</Link>
                <Link to="/premios">Ver Premios</Link>

                

            </div>
        </nav>
    );
}

const styles = {
    nav: {
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        padding: "10px 20px",
        backgroundColor: "#f5f5f5",
        borderBottom: "1px solid #ddd",
    },
    links: {
        display: "flex",
        gap: "15px",
    },
    link: {
        textDecoration: "none",
        color: "#007bff",
        fontWeight: "bold",
    },
};

export default Navbar;
